import { useParams } from "react-router-dom";
import styled from 'styled-components'
import React from 'react';
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from 'react-responsive-carousel';
import Detail_Header from "./Detail_Header";

function Detail(props){
  let params = useParams();
  console.log(params);
  let id = parseInt(params['*']);
  let shoe = props.shoes.find(x => x.id === id);
  if (!shoe) {
    return <div>해당 프로젝트를 찾을 수 없습니다.</div>;
  }

  return (
    <div className="Detail_Header">
      <div className="row">
        <div className="col-md-6">
        <Carousel showThumbs={false}>
            {shoe.imageURL.map((url, index) => (
              <div key={index}>
                <img src={url} style={{width: '100%', height: '100%', objectFit: 'cover', paddingLeft: 16, paddingRight: 16, flexDirection: 'column', justifyContent: 'flex-start', alignItems: 'center', gap: 24, display: 'inline-flex'}} />
              </div>
            ))}
          </Carousel>
        </div>
        <div style={{width: 380, height: 0, color: '#00C4C4',fontSize: 14, fontFamily: 'Pretendard',lineHeight: 3, wordWrap: 'break-word'}}><p>{shoe.content}</p></div>
        <div style={{width: 380, hegiht: 0, color: 'black', fontSize: 24, fontFamily: 'Pretendard', textAlign:"center", lineHeight: 15, wordWrap: 'break-word'}}><h4 className="pt-5">{shoe.title}</h4></div>
        <div style={{width: '100%', height: 45, justifyContent: 'space-between', alignItems: 'center', display: 'inline-flex'}}>
    <div style={{width: 80, height: 210, color: '#212529', fontSize: 12, fontFamily: 'Pretendard', fontWeight: '700', lineHeight: 18, wordWrap: 'break-word'}}>{shoe.makername}</div>
    <div style={{justifyContent: 'flex-start', alignItems: 'flex-start', gap: 8, display: 'flex'}}>
        <div style={{width: 150, color: '#ADB5BD', fontSize: 12, fontFamily: 'Pretendard', fontWeight: '400', lineHeight: 18, wordWrap: 'break-word'}}>진행 기간　{shoe.projectEndday}</div>
    </div>
</div>
        <div style={{width: '100%', height: '100%', flexDirection: 'column', justifyContent: 'center', alignItems: 'flex-start', display: 'inline-flex'}}>
    <div style={{width: '100%', height: 1, position: 'relative', background: '#F2F4F6'}} /></div>



    <div style={{width: '100%', height: '100%', flexDirection: 'column', justifyContent: 'flex-start', alignItems: 'flex-start', gap: 9.23, display: 'inline-flex'}}>
    <div style={{height: 46, flexDirection: 'column', justifyContent: 'center', alignItems: 'flex-start', gap: 14, display: 'flex'}}>
        <div style={{alignSelf: 'stretch', height: 4, flexDirection: 'column', justifyContent: 'center', alignItems: 'flex-start', display: 'inline-flex'}}>

        </div>
        <div style={{display: 'flex', flexDirection: 'column', alignItems: 'flex-start', justifyContent: 'flex-end', gap: '9.23px', width: '100%', height: '100%'}}>
    <div style={{display: 'flex', flexDirection: 'column', alignItems: 'flex-start', justifyContent: 'center', gap: '14px', height: '46px'}}>
        <div style={{display: 'flex', flexDirection: 'column', alignItems: 'flex-start', justifyContent: 'center', height: '4px', alignSelf: 'stretch'}}>
            <div style={{width: '327px', height: '4px', background: '#DDE2E6', borderRadius: '20px'}} />
            <div style={{width: '299px', height: '4px', background: '#00C4C4', borderRadius: '20px'}} />
        </div>
        <div style={{display: 'flex', justifyContent: 'space-between', alignItems: 'center', alignSelf: 'stretch'}}>
            <div style={{display: 'flex', justifyContent: 'flex-start', alignItems: 'flex-end', gap: '6px'}}>
                <div style={{width: '209px', color: '#00C4C4', fontSize: '18px', fontFamily: 'Pretendard', fontWeight: '700', lineHeight: '28px', wordWrap: 'break-word'}}>1,000,000원이 모였어요</div>
            </div>
            <div style={{color: '#ADB5BD', fontSize: '12px', fontFamily: 'Pretendard', fontWeight: '400', wordWrap: 'break-word'}}>99% 달성</div>
        </div>
    </div>
</div>

                </div>
            </div>



      </div>


    </div>  
  )
};

export default Detail;
